import React, { Component } from 'react';
import Timeline from './Timeline';
import App from './App';
import './jawad-profile.jpg'

class Post extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <div className='post-container'>
        <img src='jawad-profile.jpg' alt='prfl'></img>
          <div className='top'>
            <h4>Name</h4>
            <h4>Time</h4>
          </div>

          <div className='post-content'>
            <p>When I was little I had a car door slammed shut on my hand and I still remember it quite vividly.I think I will buy the red car, or I will lease the blue one.She wrote him a long letter, but he didn't read it.Wow, does that work?The mysterious diary records the voice.Abstraction is often one floor above you.Nobody loves a pig wearing lipstick.Don't put peanut butter on the dog's nose.There's an art to getting your way, and spitting olive pits across the table isn't it.She hadn't had her cup of coffee, and that made things all the worse.</p>
          </div>
        </div>
      </div>
    )
  }
}

export default Post;
